import { DataType, SortDirection } from './enums';
import { CssClasses } from './Models/CssClasses';
var DefaultOptions = /** @class */ (function () {
    function DefaultOptions() {
        this.columnDataType = DataType.String;
        this.columnSortDirection = SortDirection.Ascend;
        this.css = new CssClasses();
    }
    return DefaultOptions;
}());
var defaultOptions = new DefaultOptions();
export default defaultOptions;
